variables.derivation:
Set to "DOSE NOT CHANGED" if AE.AEACN = "No Action Taken";
else set to "DRUG WITHDRAWN" if AE.AEACN = "Drug Permanently Discontinued";
else set to "DRUG INTERRUPTED" if AE.AEACN = "Infusion Interrupted";
else set to "TREATMENT CYCLE DELAYED" if AE.AEACN = "Treatment Cycle Delayed";
else set to "NOT APPLICABLE" if AE.AEACN = "Not Applicable".

Set to "None" if AE.AEACNO=1;
else set to "Medication" if AE.AEACNO1=1 and all of (AE.AEACNO2, AE.AEACNO3, AE.AEACNO4)  are equal to 0;
else set to "Non-Drug Treatment" if AE.AEACNO4=1 and all of (AE.AEACNO1, AE.AEACNO2, AE.AEACNO3)  are equal to 0;
else set to "Hospitalization or Prolonged" if AE.AEACNO2=1 and all of (AE.AEACNO1, AE.AEACNO3, AE.AEACNO4)  are equal to 0;
else set to "Other" if AE.AEACNO3=1 and all of (AE.AEACNO1, AE.AEACNO2, AE.AEACNO4)  are equal to 0;
else set to "Multiple" if more than one of (AE.AEACNO1, AE.AEACNO2, AE.AEACNO3, AE.AEACNO4)  are equal to 1.

Set to "RECOVERED/RESOLVED" if AE.AEOUT = "Resolved";
else set to "RECOVERED/RESOLVED WITH SEQUELAE" if AE.AEOUT = "Recovered/Resolved With Sequelae";
else set to "RECOVERING/RESOLVING" if AE.AEOUT = "Recovering/Resolving";
else set to "NOT RECOVERED/NOT RESOLVED" if AE.AEOUT = "Not Recovered/Resolved";
else set to "FATAL" if AE.AEOUT = "Fatal";
else set to "UNKNOWN" if AE.AEOUT = "Unknown".

Only for PCSTAT is missing:
(1) Merge PC/PC1.INSTANCENAME and EC.INSTANCENAME per subject;
(2) set to ECSTDAT_RAW and ECENTIM in ISO 8601 format if PCTPTNUM=2;
      else set to ECSTDAT_RAW and ECSTTIM in ISO 8601 format.

[PR2]: set to PRTRTO in upper case text if PRTRT1_STD = 99;
else set to PRTRT1 in upper case text.
[CMSYSTN/CMCT]: set to CMTRT1 in upper case text.

[CMSYSTN]: set to "Multiple" if multiple indication are selected;
else set to "Adverse Event" if CMINDC1_RAW = "1";
else set to "Medical History" if CMINDC2_RAW = "1";
else set to "Relevant Tumor History" if CMINDC3_RAW = "1";
else set to "Preventive" if CMINDC4_RAW = "1";
else set to "Other" if CMINDC5_RAW = "1".

[PR2]: set to "ug" if PRDOSU1_STD = 1;
else set to "mg" if PRDOSU1_STD = 2;
else set to "g" if PRDOSU1_STD = 3;
else set to "mL" if PRDOSU1_STD = 4;
else set to "IU" if PRDOSU1_STD = 9;
else set to PRDOSU1 in upper case text.
[CMSYSTN/CMCT]: set to "ug" if CMDOSU_STD = 1;
else set to "mg" if CMDOSU_STD = 2;
else set to "g" if CMDOSU_STD = 3;
else set to "mL" if CMDOSU_STD = 4;
else set to "IU" if CMDOSU_STD = 9;
else set to CMDOSU in upper case text.

[PR2]: set to "QD" if PRDSFRQ1_STD = 1;
else set to "BID" if PRDSFRQ1_STD = 2;
else set to "TID" if PRDSFRQ1_STD = 3;
else set to "QID" if PRDSFRQ1_STD = 4;
else set to "1 TIME PER WEEK" if PRDSFRQ1_STD = 5;
else set to "EVERY 2 WEEKS" if PRDSFRQ1_STD = 6;
else set to "EVERY 3 WEEKS" if PRDSFRQ1_STD = 7;
else set to "2 TIMES PER WEEK" if PRDSFRQ1_STD = 8;
else set to "QM" if PRDSFRQ1_STD = 11;
else set to "PRN" if PRDSFRQ1_STD = 12;
else set to "ONCE" if PRDSFRQ1_STD = 13;
else set to "QOD" if PRDSFRQ1_STD = 14;
else set to "QHS" if PRDSFRQ1_STD = 15;
else set to PRDSFRQ1 in upper case text.
[CMSYSTN/CMCT]: set to "QD" if CMDOSFRQ_STD = 1;
else set to "BID" if CMDOSFRQ_STD = 2;
else set to "TID" if CMDOSFRQ_STD = 3;
else set to "QID" if CMDOSFRQ_STD = 4;
else set to "PRN" if CMDOSFRQ_STD = 5;
else set to "QOD" if CMDOSFRQ_STD = 6;
else set to "1 TIME PER WEEK" if CMDOSFRQ_STD = 7;
else set to "QHS" if CMDOSFRQ_STD = 8;
else set to "OTHER" if CMDOSFRQ_STD = 99.

[UCG]: set to "CVALL" if UCGPERF_STD = 2;
set to "LVEF" if UCGLVEF is non-missing and UCGPERF_STD = 1;
set to "LVEDD" if UCGLVED is non-missing and UCGPERF_STD = 1;
set to "INTP" if UCGCLSIG is non-missing and UCGPERF_STD = 1.

[UCG]: set to UCGLVEF if UCGLVEF is non-missing;
set to UCGLVED if UCGLVED is non-missing;
set to "Normal" if UCGCLSIG_STD = 1;
set to "Abnormal" if UCGCLSIG_STD in (2,3) and UCGDESC is missing;
set to UCGDESC if UCGCLSIG_STD in (2,3) and UCGDESC is non-missing.
Note: set to null if UCGLVED in ("NA","ND","UN","NOT DONE").

[UCG]: set to "%" if UCGLVEF is non-missing;
set to "mm" if UCGLVED is non-missing.
Note: set to null if the value above are in ("NA","ND","UN","NOT DONE").

Set to SDTM.CV.CVORRES if SDTM.CV.CVTESTCD = in ("LVEF","LVEDD");
for SDTM.CV.CVTESTCD = "INTP":
set to "Normal" if SDTM.CV.CVORRES = "Normal";
else set to "Abnormal".

[UCG]: set to UCGRSNND if UCGPERF_STD = 2;
set to "Not Evaluable" if UCGCLSIG_STD = 4;
set to UCGLVED if UCGLVED in ("NA","ND","UN","NOT DONE").

[DD]: for SDTM.DD.DDTESTCD = "PRCDTH":
set to CDTHO if CDTH_STD = 99 and CDTHO is non-missing;
else set to CDTH if CDTH is non-missing and CDTHO is missing;
for SDTM.DD.DDTESTCD = "AUTOPIND":
set to DDAUTYN if DDAUTYN is non-missing.

For DM.SiteGroup="China": set to "ASIAN";
For DM.SiteGroup="exChina": 
set to "MULTIPLE" if more than one "1" in (DM.RACE_RAW, DM.RACE2_RAW, DM.RACE3_RAW, DM.RACE4_RAW, DM.RACE5_RAW, DM.RACE6_RAW, DM.RACE7_RAW, DM.RACE8_RAW);
else set to "AMERICAN INDIAN OR ALASKA NATIVE" if DM.RACE_RAW="1";
else set to "ASIAN" if DM.RACE2_RAW="1";
else set to "BLACK OR AFRICAN AMERICAN" if DM.RACE3_RAW="1";
else set to "NATIVE HAWAIIAN OR OTHER PACIFIC ISLANDER" if DM.RACE4_RAW="1";
else set to "WHITE" if DM.RACE5_RAW="1";
else set to "NOT REPORTED" if DM.RACE6_RAW="1";
else set to "UNKNOWN" if DM.RACE7_RAW="1";
else set to "OTHER" if DM.RACE8_RAW="1".

For DM.SiteGroup="China": set to "NOT HISPANIC OR LATINO";
For DM.SiteGroup="exChina": 
set to "HISPANIC OR LATINO" if DM.ETHNIC="Hispanic or Latino";
set to "NOT HISPANIC OR LATINO" if DM.ETHNIC="Not Hispanic or Latino";
set to "NOT REPORTED" if DM.ETHNIC="Disclosure not permitted per regulation";
set to "UNKNOWN" if DM.ETHNIC="Unknown".

Convert China randomization file Subject_enroll_info_UAT_AK112-301-dummy.xlsx to sas data RAND_CHINA;
Convert exChina randomization file AK112-301_Rand_Dummy_v1.xlsx to sas data RAND_EXCHINA;

For DM.SiteGroup="China": merge with RAND_CHINA by subject ID, get TREATMENT_ARM, set to "AK112 20mg/kg Q3W + Pemetrexed + Carboplatin" if TREATMENT_ARM="Treatment Arm", set to "Placebo + Pemetrexed + Carboplatin" if TREATMENT_ARM="Placebo Arm";

For DM.SiteGroup="exChina": merge with RAND_EXCHINA by randomized ID, get TREATMENT_DESCRIPTION, set to "AK112 20mg/kg Q3W + Pemetrexed + Carboplatin" if TREATMENT_DESCRIPTION="AK112 injection", set to "Placebo + Pemetrexed + Carboplatin" if TREATMENT_DESCRIPTION="Placebo"

Set to "SCREEN FAILURE" if ENROLL.DSYN="No" or DSRAND.DSYN="No";
else set to "ASSIGNED, NOT TREATED" if ARM is non missing and ACTARM is missing;
else set to "NOT ASSIGNED" if ENROLL.DSYN is missing and DSRAND.DSYN is missing.

[DSIC]: set to "INFORMED CONSENT OBTAINED";
[ENROLL]: set to "ENTERED INTO TRIAL" if DSYN='Yes', else set to DSREO in upper case if DSREASND='Other', else set to DSREASND in upper case; 
[DSRAND]: set to "RANDOMIZED" if DSYN='Yes', else set to DS1REO in uppercase if DSREASN1='Other', else set to DSREASN1 in uppercase; 
[DSEOT]: set to DSDEO in uppercase if DSDEO is non-missing, else set to DSDEPD in uppercase if DSDEPD is non-missing, else set to DSDECOD1 in uppercase; 
[DS]: set to DSDEO in uppercase if DSDEO is non-missing, else set to DSDECOD in uppercase.

[DSIC]: set to "INFORMED CONSENT OBTAINED";
[ENROLL]: set to "ENTERED INTO TRIAL" if DSYN='Yes', else set to "PHYSICIAN DECISION" if DSREASND='Investigator Decision', else set to DSREASND in uppercase; 
[DSRAND]: set to " RANDOMIZED" if DSYN='Yes', else set to "ELIGIBILITY CRITERIA NOT MET" if DSREASN1='Did not Satisfy all Inclusion/Exclusion Criteria', else set to DSREASN1 in uppercase; 
[DSEOT]: set to "PHYSICIAN DECISION" if DSDECOD1="Investigator Decision", set to "PROGRESSIVE DISEASE" if DSDECOD1="Radiographic Progression"/"Symptomatic Deterioration without Radiographic Evidence", set to "WITHDRAWAL BY SUBJECT" if DSDECOD1="Subject Request", set to "PROTOCOL DEVIATION" if DSDECOD1="Significant Protocol Deviations", set to "COMPLETED" if DSDECOD1="Subjects Complete Study Treatment per Protocol (up to 24 months of treatment)", else set to DSDECOD1 in uppercase; 
[DS]: set to DSDECOD in uppercase.

[DSIC]: set to "PROTOCOL MILESTONE";
[ENROLL]: set to "PROTOCOL MILESTONE" if DSYN='Yes', else set to "DISPOSITION EVENT" if DSYN='No'; 
[DSRAND]: set to "PROTOCOL MILESTONE" if DSYN='Yes', else set to "DISPOSITION EVENT" if DSYN='No'; 
[DSEOT]: set to "DISPOSITION EVENT";
[DS]: set to "DISPOSITION EVENT".

[DSIC]: set to "INFORMED CONSENT";
[ENROLL]: set to "ENROLLMENT STATUS";
[DSRAND]: set to "RANDOMIZATION";
[DSEOT]: set to "END OF TREATMENT";
[DS]: set to "END OF STUDY".

[DSIC]: set to DSSTDAT_RAW in ISO 8601 format;
[ENROLL]: set to DSSTDAT1_RAW in ISO 8601 format;
[DSRAND]: set to DSSTDAT_RAW in ISO 8601 format;
[DSEOT]: set to DSSTDAT_RAW in ISO 8601 format;
[DS]: set to DSSTDAT_RAW in ISO 8601 format.

[EC]: set to "AK112/PLACEBO";
[EC1]: set to "PEMETREXED";
[EC2]: set to "CARBOPLATIN".

[EC]: set to "SCHEDULED" if ECPDOSE_RAW is not missing;
else set to "PERFORMED" if ECADOSE_RAW is not missing.
