else set to "PERFORMED" if ECADOSE_RAW is not missing.
[EC2]: set to "SCHEDULED" if ECDSTXT1_RAW is not missing;
else set to "PERFORMED" if ECADOSE_RAW is not missing.

Only for ECMOOD = "PERFORMED":
[EC/EC1/EC2]: set to "Y" if ECYN_STD=1;
else set to "N" if ECYN_STD=2.

[EG]: set to "EGALL" if EGPERF_STD = 2;
else if EGPERF_STD = 1:
set to "EGHRMN" if EGHR_RAW is non-missing;
set to "RRAG" if EGRR_RAW is non-missing;
set to "PRAG" if EGPR_RAW is non-missing;
set to "QRSAG" if EGQRS_RAW is non-missing;
set to "QTAG" if EGQT_RAW is non-missing;
set to "QTCBAG" if EGQTC_RAW is non-missing and EGQTCMET_STD = 1;
set to "QTCFAG" if EGQTC_RAW is non-missing and EGQTCMET_STD = 2;
set to "QTCMAC" if EGQTC_RAW is non-missing and EGQTCMET_STD = 3;
