[EG]: if EGPERF_STD = 1:
set to EGHR_RAW if EGHR_RAW is non-missing;
set to EGRR_RAW if EGRR_RAW is non-missing;
set to EGPR_RAW if EGPR_RAW is non-missing;
set to EGQRS_RAW if EGQRS_RAW is non-missing;
set to EGQT_RAW if EGQT_RAW is non-missing;
set to EGQTC_RAW if EGQTC_RAW is non-missing;
