Note: set to null if the value above are in ("NA","ND","UN","NOT DONE","UNK").

[EG]: if EGPERF_STD = 1:
set to "beats/min" if EGHR_RAW is non-missing;
set to "ms" if EGRR_RAW is non-missing;
set to "ms" if EGPR_RAW is non-missing;
set to "ms" if EGQRS_RAW is non-missing;
set to "ms" if EGQT_RAW is non-missing;
set to "ms" if EGQTC_RAW is non-missing.
Note: set to null if the value above are in ("NA","ND","UN","NOT DONE","UNK").

For SDTM.EG.EGTESTCD = "INTP":
set to "Normal" if SDTM.EG.EGORRES = "Normal";
else set to "Abnormal";
for other value of SDTM.EG.EGTESTCD:
set to SDTM.EG.EGORRES.

[EG]: set to EGREASND if EGPERF_STD = 2;
set to "Not Evaluable" if EGCLSIG_STD = 4.
Note: set to SDTM.EG.EGORRES if SDTM.EG.EGORRES in ("NA","ND","UN","NOT DONE","UNK").

[EC]: set to "AK112/PLACEBO";
[EC1]: set to "PEMETREXED";
[EC2]: set to "CARBOPLATIN".

[EC]: set to ECADOSE/(ECPDOSE/20);
[EC1]: set to ECADOSE/ECBSA;
[EC2]:set to ECADOSE/ECCC;

[EC]: set to "mg/kg" if EXDOSE is not missing;
