[ERYN]: For FATESTCD="EXPNY", set to ERYN;
[PD]: For FATESTCD="TPSSCORE", set to PDSCORE.

[MHDIAG]: For FATESTCD="CELLCAR", set to MHCATNSC; 
For FATESTCD="HISGRD", set to MHIDCAT;
For FATESTCD= "STGT", set to MHSCRTS;
For FATESTCD= "STGN", set to MHSCRNS;
For FATESTCD="STGM", set to MHSCRMS;
For FATESTCD="CLISTG", set to MHSCRTG, 
For FATESTCD="RELAP", set to MHMET;
For FATESTCD="METAST", set to MHMET1;
[ERYN]: For FATESTCD="EXPNY", set to ERYN;
[PD]: For FATESTCD="TPSSCORE", set to PDSCORE.

[MI]: set to "G719X" if MISPEC1_RAW="1";
set to "19Del" if MISPEC2_RAW="1";
set to "S768I" if MISPEC3_RAW="1";
set to "T790M" if MISPEC4_RAW="1";
set to "L858R" if MISPEC5_RAW="1";
set to "L861Q" if MISPEC6_RAW="1";
set to "Other" if MISPEC7_RAW="1";
[TM]: set to "T790M".

If IE.IEYN_STD = 2:
merge raw dataset IE and DSIC by SUBJECT and FOLDERNAME to get DSIC.DSVER (if DSIC.DSVER = "Other" then get DSIC.DSVERO);
concatenate "IN" and numeric part of IE.IETESTCD in z2. format if IE.IETESTCD contains string "Inclusion";
else concatenate "EX" and numeric part of IE.IETESTCD in z2. format if IE.IETESTCD contains string "Exclusion".
else concatenate "O" and the alphabetical order of unique IE.IETESTO in z2. format if IE.IETESTCD = "Other".

(Note: If a criterion has changed in protocol amendment without given new number, IETESTCD will be created by appending letter "A" or "B", e.g., IN01A)

Set to "INCLUSION" if IE.IETESTCD contains string "Inclusion";
else set to "EXCLUSION" if IE.IETESTCD contains string "Exclusion";
else set to "OTHER" if IE.IETESTCD = "Other".

[PCADA]: Set to PCREASND if PCPERF="No";
[PCADA1]: Set to PCREASND if PCPERF="No";
else set to PCRESND1 if PCSTAT=1.

[LBHEMA]: set to HB_UN or PCV_UN or RBC_UN or PLT_UN or WBC_UN or LYM1_UN or LYM2_UN or NEUT1_UN or NEUT2_UN or MONO1_UN or MONO2_UN or EOS1_UN or EOS2_UN or BASO1_UN or BASO2_UN.
[LBHEMA2]: set to LBUNITO if LBUNIT='Other'; else set to LBUNIT.
[LBURNI]: set to LBPH_UN or LBPRO_UN or LBSG_UN or LBGLU1_UN or LBBIL_UN or LBKET_UN or LBOB_UN or LBUL_UN or LBUE_UN.
[LBURNI2]: set to null if LBUNIT4='Other'; else set to LBUNIT4.
[LBCHEM]: set t LBALB_UN or LBGLU_UN or LBUA_UN or LBTP_UN or LBUREA_UN or LBBUN_UN or LBCRP_UN or LBCR_UN or CRCL_UN or LBCA_UN or LBPP_UN or LBMA_UN or LBSOD_UN or LBPOT_UN or LBCHL_UN or LBAST_UN or LBALT_UN or LBALP_UN or LBTBIL_UN or LBDBIL_UN or LBGGT_UN or LBLDH_UN or LBCK_UN or LBTRI_UN or LBCHO_UN or LBLIP_UN or LBAMY_UN.
[LBCHEM2]: for LBTESTCD='CREATCLR' set to 'mL/min';
                    for other LBTESTCD set to LBUNITO if LBUNIT2='Other'; else set to LBUNIT2.
[LBCOAG]: set to LBPT_UN or LBAPTT_UN or LBINR_UN.
[LBCOAG2]: for LBUNIT3='Other' and SDTM.LB.LBORRES is not missing: set to "s" if SDTM.LB.LBTESTCD in ("PT", "APTT"); else set to "RATIO" if SDTM.LB.LBTESTCD in="INR".
for LBUNIT3 is not equal to "Other": set to LBUNIT3.
[LBTHY]:  set to TSH_UN or FT4_UN or FT3_UN.
[LBTHY2]: set to LBUNITO if LBUNIT6='Other'; else set to LBUNIT6.
[LBUPRO]: set to LBUP_UN.
[LBUPRO2]: set to LBUNITO if LBUNIT5='Other'; else set to LBUNIT5.
[LBOTH]: set to LBOUNITO if LBOUNIT='Other'; else set to LBOUNIT.

Note: if SDTM.LB.LBORRESU in ("NA", "NO UNITS", "QUALITATIVE", "UNITLESS", "UNKNOWN, "ND"," NOT DONE","ND-NOT DONE", "NOT APPLICABLE","NO UNIT","NO UNIT OF MEASUREMENT","NO VALUE","RATIO","UNITLESS", "NO MEASUREMENT", "NOT LISTED", "NO UNIT AVAILABLE", "UA", "#ND") then set to null;
else if SDTM.LB.LBORRESU in ("/HP", "PER HP", ""HPF) then set to "/HPF";
else if SDTM.LB.LBORRESU in ("10E12/L", "M/UL", "T/L", "10^6/uL") then set to "10^12/L";
else if SDTM.LB.LBORRESU in ("/UL", "/ul", "10E6/L", "PER UL", "PER/UL", "cells/uL") then set to "10^6/L";
else if SDTM.LB.LBORRESU in ("10E9/L", "G/L", "K/UL", "10^3/uL") then set to "10^9/L";
else if SDTM.LB.LBORRESU in ("℃") then set to "C";
else if SDTM.LB.LBORRESU in ("ΜIU/ML") then set to "IU/L";
else if SDTM.LB.LBORRESU in ("IU/ML") then set to "IU/mL";
else if SDTM.LB.LBORRESU in ("Fl") then set to "fL";
else if SDTM.LB.LBORRESU in ("G/DL") then set to "g/dL";
else if SDTM.LB.LBORRESU in ("g/24h") then set to "g/day";
else if SDTM.LB.LBORRESU in ("KG") then set to "kg";
else if SDTM.LB.LBORRESU in ("UIU/ML", "uIU/ml") then set to "mIU/L";
else if SDTM.LB.LBORRESU in ("UG/ML") then set to "mg/L";
else if SDTM.LB.LBORRESU in ("MM/H") then set to "mm/h";
else if SDTM.LB.LBORRESU in ("MMHG") then set to "mmHg";
else if SDTM.LB.LBORRESU in ("pg/mL", "pg/ml") then set to "ng/L";
else if SDTM.LB.LBORRESU in ("ng/dl") then set to "ng/dL";
else if SDTM.LB.LBORRESU in ("NMOL/L") then set to "nmol/L";
else if SDTM.LB.LBORRESU in ("PG") then set to "pg";
else if SDTM.LB.LBORRESU in ("S", "SECONDS", "Sec", "sec") then set to "s";
else if SDTM.LB.LBORRESU in ("UG/L", "ng/mL") then set to "ug/L";
else if SDTM.LB.LBORRESU in ("NG/ML FEU") then set to "ug/L FEU".
else if SDTM.LB.LBORRESU in ("MG/L") then set to "mg/L".
else if SDTM.LB.LBORRESU in ("MEQ/L") then set to "mEq/L".
else if SDTM.LB.LBORRESU in ("UU/ML") then set to "mU/L".
else if SDTM.LB.LBORRESU in ("G/ML") then set to "kg/L".
else if SDTM.LB.LBORRESU in ("UU/ML") then set to "mU/L".
elseif SDTM.LB.LBORRESU in ("/ML") then set to "10^3/L".

For SDTM.LB.LBCAT = "OTHER LAB ASSESSMENT":
same as LBORRES.

For the others:
Derived from LBORRES base on LDD.SMT_CONVERSION_FN if SMT_CONVERSION_FN exists;
else set to null if LDD.SMT_CONVERSION_FN isn't exists;

[LBOTH]: Concatenate LBOLNR and LBOUNR with " - " if LBORNRLO and LBORNRHI is both missing.
Note: if LBOLNR="NEGATIVE" and LBOUNR="NEGATIVE" then set to "NEGATIVE";
else if LBOLNR="NON-REACTIVE" and LBOUNR="NON REACTIVE" then set to "NON-REACTIVE";
else if LBOLNR="0" & LBOUNR="NOT HAVE" then set to "NOT HAVE".

For LAB.FORM in ("LBHEMO", "LBCHEM", "LBURNI", "LBCOAG", "LBTHY", "LBUPRO"):
Set to "NORMAL" if SDTM.LB.LBSTNRLO<=SDTM.LB.LBSTRESN<=SDTM.LB.LBSTNRHI;
else set to "LOW" if SDTM.LB.LBSTRESN<SDTM.LB.LBSTNRLO;
else set to "LOW" if SDTM.LB.LBSTRESN is missing and SDTM.LB.LBSTRESC contains symbol ("<") and the maximum value<=SDTM.LB.LBSTNRLO;
else set to "HIGH" if SDTM.LB.LBSTNRHI<SDTM.LB.LBSTRESN;
else set to "HIGH" if SDTM.LB.LBSTRESN is missing and SDTM.LB.LBSTRESC contains symbol (">") and the minimum value>=SDTM.LB.LBSTNRHI.

[LBOTH]:
Set to "ABNORMAL" if LBOCLSIG in ("Abnormal, Clinically Significant", "Abnormal, Not Clinically Significant");
