[TUTL2]: for TRTESTCD="LDIAMSAX", if TUYN="Yes" and any one of TURSNND1-TURSNND8 is non missing or TUSTAT_RAW="1": set to 'Multiple" if any two variables are equal to 1 in TURSNND1-TURSNND8, else set to "Lesion or Background Change that Prevents Evaluation" if TURSNND1=1, else set to "Focal Intervention" if TURSNND2=1, else set to "Poor Scan Quality" if TURSNND3=1, else set to "Insufficient Images/Anatomy" if TURSNND4=1, else set to "Inconsistent Modality" if TURSNND5=1, else set to "Site Error" if TURSNND6=1, else set to "Other" if TURSNND7=1, else set to TURSNND8;
