[TUNL]: for TRTESTCD="LDIAMSAX": set to "ND" if TUDIA_RAW="ND"; else if TUNLYN='Yes' and TUDIA_RAW is missing: set to 'Multiple" if any two variables are equal to 1 in TUNREAS1-TUNREAS8, else set to "Lesion or Background Change that Prevents Evaluation" if TUNREAS1=1, else set to "Focal Intervention" if TUNREAS2=1, else set to "Poor Scan Quality" if TUNREAS3=1, else set to "Insufficient Images/Anatomy" if TUNREAS4=1, else set to "Inconsistent Modality" if TUNREAS5=1, else set to "Site Error" if TUNREAS6=1, else set to "Other" if TUNREAS7=1, else set to TUNREAS8;
