[CNS2]: for TRTESTCD="LDIAM", set to CNSRES if CNSYN="Yes" and CNSND unequal to "1" and CNSDIA_RAW is missing;
[CNS4]: for TRTETSCD="TUMSTATE", set to "Not Applicable" if CNSYN3="Not Applicable";
[CNS5]: for TRTESTCD="LDIAM", set to "ND" if CNSDIA_RAW="ND", set to CNSRES2 if CNSYN4="Yes" and CNSND_RAW unequal to "1" and CNSDIA_RAW is missing;
[CNS6]: for TRTESTCD="LDIAM", set to "ND" if CNSDIA_RAW="ND", set to CNSRES2 if CNSYN4="Yes" and CNSDIA_RAW is missing;
[CNS]:  for TRTESTCD="TRALL", set to TUREASND;
[IRC_LESION]: for TRTESTCD="LDIAMSAX": set to LSTATUS if TLLONG="NA" and TLSAXIS="NA" and VISITNAME not contain "Uns";
[IRC_VISIT]: TRTESTCD="SUMDIAM": set to SUMDIAM1 if SUMDIAM1 equal to "NE" or "NA".

