For subjects who received at least one dose of study treatment (SAFFL = "Y") and DS.DSCAT = "DISPOSITION EVENT" and DS.DSSCAT = "END OF TREATMENT":
Set to "COMPLETED" if DS.DSDECOD = "COMPLETED";
else set to "DISCONTINUED" if DS.DSDECOD does not equal to "COMPLETED";
else set to "ONGOING" if TRTSDT is not missing.
For subjects who did not receive study treatment (TRTSDT is missing), set to null.

CORT2FL = "Y" when any of the following conditions are met:
1. ATC2CD is equal to "D07";
2. ATC3CD is equal to S01B" or "S01C";
3. ATC3CD is equal to S02B" or "S02C";
4. ATC3CD is equal to S03B" or "S03C".
Note: This is a topical steroid Flag.

For subjects who had IRC PD, set to first PD date as ADEFF.ADT where ADEFF.PARAMCD = "IRCFSTPD";
Else for subjects who deceased, set to ADSL.DTHDT;
Else for subjects who had post-baseline evaluable IRC response assessments, set to the date of the last evaluable IRC response assessment as ADEFF.ADT where ADEFF.PARAMCD = "IRCLSTRS";
Else set to randomization date ADSL.RANDDT.

For subjects who had INV PD, set to first PD date as ADEFF.ADT where ADEFF.PARAMCD = "INVFSTPD";
Else for subjets who deceased, set to ADSL.DTHDT;
Else for subjects who had post-baseline evaluable INV response assessments , set to the date of the last evaluable INV response assessment as ADEFF.ADT where ADEFF.PARAMCD = "INVFSTPD"; 
Else set to randomization date ADSL.RANDDT.

For subjects who had intracranial progression, set to the earliest scan date that showed a new brain lesion or porgression of a non-target brain lesion; 
else set to ADSL.DTHDT if subject died;
else set to the date of the last evaluable assessment (the latest scan date if multiple scans were involved in the same visit) if subject had post-baseline tumor assessments;
else set to randomization date ADSL.RANDDT.

Only derive for subjects who were randomized on or prior to the 231th PFS events date (ADEFF.IRC231DT). 
If subject had IRC PD on or prior to the 231th PFS events date then set to the first IRC PD date (ADEFF.ADT where ADEFF.PARAMCD = "IRCFSTPD");
Else if subject died on or prior to the 231th PFS events date then set to death date (ADSL.DTHDT);
Else if subject had post-baseline evaluable IRC response assessment on or prior to the 231th PFS events date then set to the date of last evaluable IRC response assessment on or prior the 231th PFS events date (ADEFF.ADT where ADEFF.PARAMCD = "IRCLRSBC".
Else set to randomization date (ADSL.RANDDT).

If subject had IRC PD on or prior to IA data extract date then set to the first IRC PD date (ADEFF.ADT where ADEFF.PARAMCD = "IAIRCFPD");
Else if subject died on or prior to IA data extract date then set to death date (ADSL.DTHDT);
Else if subject had post-baseline evaluable IRC response assessment on or prior to IA data extract date then set to date of last evaluable IRC response assessment (ADEFF.ADT where ADEFF.PARAMCD = "IAIRCLRS"); 
Else set to randomization date (ADSL.RANDDT).

If subject had INV PD on or prior to IA data extract date then set to the first INV PD date (ADEFF.ADT where ADEFF.PARAMCD = "IAINVFPD");
Else if subject died on or prior to IA data extract date then set to death date (ADSL.DTHDT);
Else if subject had post-baseline evaluable INV response assessment on or prior to IA data extract date then set to date of last evaluable INV response assessment (ADEFF.ADT where ADEFF.PARAMCD = "IAINVLRS"); 
Else set to randomization date (ADSL.RANDDT).

Only derive for subjects who were randomized on or prior to the 231th PFS events date (ADEFF.IRC231DT). 
If subject had IRC PD on or prior to IA data extract date and on or prior to the 231th PFS events date, then set to the first IRC PD date (ADEFF.ADT where ADEFF.PARAMCD = "IAIRCFPD");
Else if subject died on or prior to IA data extract date and on or prior to the 231th PFS events date, then set to death date (ADSL.IADTHDT);
Else if subject had post-baseline evaluable IRC response assessment on or prior to the 231th PFS events, then set to date of last evaluable IRC response assessment on or prior to the 231th PFS events (ADEFF.ADT where ADEFF.PARAMCD = "IRCLRSBC").
Else set to randomization date (ADSL.RANDDT).

EVNTDESC = "Deterioration" if a subject had deterioration;
else EVNTDESC = "Death" if a subject died;
else EVNTDESC = "Censored".
